#Rosalind Problem: SSEQ
#source
'''Given: Two DNA strings s and t (each of length at most 1 kbp) in FASTA format.
Return: One collection of indices of ss in which the symbols of tt appear as a subsequence of s. If multiple solutions exist, you may return any one.'''

class SSEQ:
    def __init__(self,s,t):
        s_index = 0
        s_len = len(s)
        subsequence_indexing = []
        for letter in t:
            while (s_index < s_len and s[s_index] != letter):
                s_index += 1
            subsequence_indexing.append(s_index + 1)
            s_index += 1
        self.subsequence_indexing =  subsequence_indexing

def Main():
    s = ''
    t = ''
    sseq = SSEQ(s,t)
    print(*sseq.subsequence_indexing)

if __name__ == '__main__':
    Main()
